import ExpenseItem from './components/ExpenseItem';

// parent component 

function App() {
    // let expenseDate = new Date(2023, 12, 31);
    // let expenseTitle = "School Fee";
    // let expenseAmount = 67;



    // Return me both pass kar sakte h component and tag
    // Capital se component
    // Small se tag

     // array of object //1 array 4 object

     let expenses =[
        {
            id:'e1',
            title: 'schoolfee',
            amount: 250,
            date: new Date(2021, 5, 12)


        },
        {
            id:'e2',
            title: 'books',
            amount: 230,
            date: new Date(2021, 5, 12)


        },
        {
            id:'e3',
            title: 'House rent',
            amount: 700,
            date: new Date(2021, 5, 12)


        },
        {
            id:'e4',
            title: 'food',
            amount: 700,
            date: new Date(2021, 5, 12)


        }
     ]


    // Props components ke through data bhejna
    return (
        <div>
            <h2>Let's get started</h2>
            
 <ExpenseItem
                data={expenses[0].date}
                title={expenses[0].title}
                amount={expenses[0].amount}
            />

<ExpenseItem
                data={expenses[1].date}
                title={expenses[1].title}
                amount={expenses[1].amount}
            />

<ExpenseItem
                data={expenses[2].date}
                title={expenses[2].title}
                amount={expenses[2].amount}
            />


<ExpenseItem
                data={expenses[3].date}
                title={expenses[3].title}
                amount={expenses[3].amount}
            />
            

          
        </div>
    );
}

export default App;
